export const getBattleLibrary = (): BattleSummary[] => {
  const lines = RAW_CSV.split('\n');
  const battles: BattleSummary[] = [];

  for (let i = 1; i < lines.length; i++) {
    const line = lines[i].trim();
    if (!line) continue;
    
    const cols = line.split(',');
    
    const battle: BattleSummary = {
      id: cols[0],
      battleId: cols[1],
      createdAt: cols[2],
      status: cols[3],
      artistA: {
        id: 'A',
        name: cols[4],
        color: '#22B5E8', // Wave Blue
        avatar: cols[11],
        wallet: cols[6],
        musicLink: cols[9] !== 'null' ? cols[9] : undefined,
        twitter: cols[19] !== 'null' ? cols[19] : undefined
      },
      artistB: {
        id: 'B',
        name: cols[5],
        color: '#6FF34B', // Wave Green
        avatar: cols[11],
        wallet: cols[7],
        musicLink: cols[10] !== 'null' ? cols[10] : undefined,
        twitter: cols[20] !== 'null' ? cols[20] : undefined
      },
      battleDuration: parseInt(cols[16] || '0'),
      winnerDecided: cols[17] === 'true',
      imageUrl: cols[11],
      streamLink: cols[21] !== 'null' ? cols[21] : undefined,
      creatorWallet: cols[22] !== 'null' ? cols[22] : undefined,
      isCommunityBattle: cols[24] === 'true',
      communityRoundId: cols[25] !== 'null' ? cols[25] : undefined,
      isTestBattle: cols[26] === 'true'
    };

    battles.push(battle);
  }

  return battles.sort((a, b) => new Date(b.createdAt).getTime() - new Date(a.createdAt).getTime());
};